import React from "react";
import { Link } from "react-router-dom";

const Hero = props => {
  return (
    <section className="hero">
      {props.isHome ? "" : <Link to="/">Home Icon</Link>}

      <h1>{props.title}</h1>

      {props.isHome ? (
        <img src={require("../assets/icons.png")} alt="logo" />
      ) : (
        ""
      )}
    </section>
  );
};

export default Hero;
